    <style>
        body {
            background-color: black;
            z-index: 1
        }

        #myd {
            position: absolute;
            z-index: 2;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }

        #myd2 {
            position: relative;
        }
        #formdiv{
            width:450px;
        }

        .img {
            position: absolute;
            top: 80px;
            left: -50px;
        }

        input[type="text"] {
            width: 300px;
            padding: 10px;
            border: 2px solid #4CAF50;
            border-radius: 5px;
            font-size: 16px;
            transition: border-color 0.3s;
        }

        input[type="text"]:focus {
            border-color: #f44336;
        }

        .btn-gradient {
            display: inline-block;

            padding: 12px 20px;
            font-size: 16px;
            color: #fff;
            background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
            border: none;
            border-radius: 25px;
            cursor: pointer;
            transition: background 0.3s ease;
        }

        .btn-gradient:hover {
            background: linear-gradient(45deg, #2575fc 0%, #6a11cb 100%);
        }
        #canvadiv {
            position: relative;
            top: -20px;
        }
        @media (max-width: 768px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 30px;
            }
            .img {
                position: absolute;
                left: 0px;
            }
            #canvadiv {
                left: -310px;
            }
        }
        @media (max-width: 450px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 30px;
            }
            .img {
                position: absolute;
                left: 0px;
            }
            #canvadiv {
                left: -310px;
            }
            #formdiv {
                position: relative;
                left: 50px;
            }
            input[type="text"] {
                width: 200px;
            }
        }

    </style>
